import React from "react";
import { useState } from "react";
import { Link } from "react-scroll";
import "./AfterNavbar.css";

const AfterNavbar = () => {
  return (
    <nav>
      <Link className="title">Call App</Link>
      <ul>
        <li>
          <Link>Match</Link>
        </li>
        <li>
          <Link>Profile</Link>
        </li>
        <li>
          <Link>Friends</Link>
        </li>
      </ul>
    </nav>
  );
};

export default AfterNavbar;
